import { Table } from "reactstrap";
import NewCarsModal from "./NewCarsModal";
import ConfirmRemovalModal from "./ConfirmRemovalModal";

const ListCars = ({ cars }) => {
  return (
    <Table >
      <thead>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>Document</th>
          <th>Phone</th>
          <th>Registration</th>
          <th></th>
        </tr>
      </thead>
      <tbody>
        {!users || users.length <= 0 ? (
          <tr>
            <td colSpan="6" align="center">
              <b>No user available, Try creating new one</b>
            </td>
          </tr>
        ) : (
          users.map((user) => (
            <tr key={user.id}>
              <td>{user.name}</td>
              <td>{user.email}</td>
              <td>{user.document}</td>
              <td>{user.phone}</td>
              <td>{user.registrationDate}</td>
              <td align="center">
                <NewUserModal user={user} />
                &nbsp;&nbsp;
                <ConfirmRemovalModal userId={user.id} />
              </td>
            </tr>
          ))
        )}
      </tbody>
    </Table>
  );
};
export default ListUsers;
